import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ObjetList from './components/ObjetList';
import PretList from './components/PretList';
import InsertObjet from './components/InsertObjet';
import Inscription from './components/Inscription';
import Login from './components/Login';

function App() {
    return (
        <Router>
            <div>
                <Routes>
                    {/* Page d'accueil avec le composant Login */}
                    <Route path="/" element={<Login />} />

                    {/* Route pour l'inscription */}
                    <Route path="/inscription" element={<Inscription />} />

                    {/* Route pour afficher la liste des objets */}
                    <Route path="/objet-list" element={<ObjetList />} />

                    {/* Route pour afficher la liste des prêts */}
                    <Route path="/pret-list" element={<PretList />} />

                    {/* Route pour insérer un nouvel objet */}
                    <Route path="/insert-objet" element={<InsertObjet />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
